package day3;

public class whileTest4 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println("main()수행시작");
		char munja = '가';
		while(munja<='나') {
			System.out.print(munja+" ");
			munja++;
		}
		System.out.println("main()수행종료");
	}

}
